import React, { Component } from 'react';
import axios from 'axios';

class SelectVeter extends Component {
  constructor(props) {
    super(props);
    this.state = {
      names: [] // Инициализируйте массив имен
    };
  }

  componentDidMount() {
    // Выполните запрос к базе данных для получения имен
    axios.get('https://localhost:7205/api/Veterinarians')
      .then(response => {
        this.setState({ names: response.data }); // Сохраните имена в состоянии компонента
      })
      .catch(error => {
        console.log(error);
      });
  }

  render() {
    const { names } = this.state;
    return (
      <select>
        {names.map(name => (
          <option key={name.id} value={name.id}>{name.name}</option>
        ))}
      </select>
    );
  }
}

export default SelectVeter;
